    "contracts/Vault.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity <0.8.0;
pragma abicoder v2;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./hardworkInterface/IStrategyV2.sol";
import "./hardworkInterface/IVault.sol";
import "./hardworkInterface/IController.sol";
import "./hardworkInterface/IUnderlyingPool.sol";
import "./hardworkInterface/IDepositPool.sol";
import "./Controllable.sol";
import "./VaultStorage.sol";

import "hardhat/console.sol";

contract Vault is ERC20, IVault, Controllable, VaultStorage {
    using SafeERC20 for IERC20;
    using Address for address;

    address private depositPool;

    address[] public withdrawer;
    address[] public depositer;

    mapping(address => uint256) public override withdrawOrder;
    mapping(address => uint256) public override depositOrder;

    uint256 public override totalShareToWithdraw;
    uint256 public override totalShareDeposit;
    uint256 public override latestSharePrice;
    uint256 public override nextTimeAbleToRebalance;
    uint256 public override periodAbleToRebalance;
    uint256 public override sharingProfitFeeNumerator;
    uint256 public override sharingProfitFeeDenominator;
    uint256 public override depositFeeNumerator;
    uint256 public override depositFeeDenominator;
    uint256 public override nextTimeToTakeProfit;
    uint256 public override periodToTakeProfit;
    uint256 public override takeProfitSharePrice;
    uint256 public numberOfWithdrawer;

    struct HistoricalData {
        uint256 rebalanceTimestamp;
        uint256 sharePriceData;
        uint256 tvlData;
    }

    HistoricalData[] public historicalData;

    event Withdraw(address indexed beneficiary, uint256 amount);
    event Deposit(address indexed beneficiary, uint256 amount);
    event Invest(uint256 amount);
    event StrategyChanged(address newStrategy, address oldStrategy);

    modifier whenStrategyDefined() {
        require(address(strategy()) != address(0), "Strategy must be defined");
        _;
    }

    modifier defense() {
        require(
            (msg.sender == tx.origin) ||
                !IController(controller()).greyList(msg.sender),
            "This smart contract has been grey listed"
        );
        _;
    }

    constructor(
        address _storage,
        address _underlying,
        uint256 _toInvestNumerator,
        uint256 _toInvestDenominator,
        address _underlyingPool
    )
        ERC20(
            string(abi.encodePacked("NESTQUANT_", ERC20(_underlying).symbol())),
            string(abi.encodePacked("nq", ERC20(_underlying).symbol()))
        )
        Controllable(_storage)
    {
        require(
            _toInvestNumerator <= _toInvestDenominator,
            "cannot invest more than 100%"
        );
        require(_toInvestDenominator != 0, "cannot divide by 0");

        uint256 _underlyingUnit = 10 ** uint256(ERC20(_underlying).decimals());

        VaultStorage.initialize(
            _underlying,
            _toInvestNumerator,
            _toInvestDenominator,
            _underlyingUnit,
            _underlyingPool
        );

        latestSharePrice = 10 ** uint256(ERC20(_underlying).decimals());
    }

    function decimals() public view override returns (uint8) {
        return ERC20(underlying()).decimals();
    }

    function initializeParameters(
        uint256 _periodAbleToRebalance,
        uint256 _sharingProfitFeeNumerator,
        uint256 _sharingProfitFeeDenominator,
        uint256 _depositFeeNumerator,
        uint256 _depositFeeDenominator,
        uint256 _periodToTakeProfit,
        address _depositPool
    ) external override onlyControllerOrGovernance {
        nextTimeToTakeProfit = block.timestamp + _periodToTakeProfit;
        periodToTakeProfit = _periodToTakeProfit;
        nextTimeAbleToRebalance = block.timestamp + _periodAbleToRebalance;
        periodAbleToRebalance = _periodAbleToRebalance;
        depositFeeNumerator = _depositFeeNumerator;
        depositFeeDenominator = _depositFeeDenominator;
        sharingProfitFeeNumerator = _sharingProfitFeeNumerator;
        sharingProfitFeeDenominator = _sharingProfitFeeDenominator;
        depositPool = _depositPool;
    }

    function setNextTimeToTakeProfit(
        uint256 _period
    ) external override onlyControllerOrGovernance {
        require(_period >= 0, "the time is past");
        nextTimeToTakeProfit = block.timestamp + _period;
        periodToTakeProfit = _period;
    }

    function setNextTimeAbleToRebalance(
        uint256 _period
    ) external override onlyControllerOrGovernance {
        require(_period >= 0, "the time is in the past");
        nextTimeAbleToRebalance = block.timestamp + _period;
        periodAbleToRebalance = _period;
    }

    function setDepositFee(
        uint256 numerator,
        uint256 denominator
    ) external override onlyControllerOrGovernance {
        depositFeeNumerator = numerator;
        depositFeeDenominator = denominator;
    }

    function setFeePool(
        address _feePool
    ) external override onlyControllerOrGovernance {
        _setUnderlyingPool(_feePool);
    }

    function setVaultFractionToInvest(
        uint256 numerator,
        uint256 denominator
    ) external override onlyControllerOrGovernance {
        require(denominator > 0, "denominator must be greater than 0");
        require(
            numerator <= denominator,
            "denominator must be greater than or equal to the numerator"
        );
        _setVaultFractionToInvestNumerator(numerator);
        _setVaultFractionToInvestDenominator(denominator);
    }

    function setVaultFractionToTakeProfit(
        uint256 numerator,
        uint256 denominator
    ) external override onlyControllerOrGovernance {
        require(denominator > 0, "denominator must be greater than 0");
        require(
            numerator <= denominator,
            "denominator must be greater than or equal to the numerator"
        );
        sharingProfitFeeNumerator = numerator;
        sharingProfitFeeDenominator = denominator;
    }

    function strategy() public view override returns (address) {
        return _strategy();
    }

    function underlying() public view override returns (address) {
        return _underlying();
    }

    function underlyingUnit() public view override returns (uint256) {
        return _underlyingUnit();
    }

    function vaultFractionToInvestNumerator()
        public
        view
        override
        returns (uint256)
    {
        return _vaultFractionToInvestNumerator();
    }

    function vaultFractionToInvestDenominator()
        public
        view
        override
        returns (uint256)
    {
        return _vaultFractionToInvestDenominator();
    }

    function underlyingPool() public view override returns (address) {
        return _underlyingPool();
    }

    /*
     * Returns the cash balance across all users in this contract.
     */
    function underlyingBalanceInVault() public view override returns (uint256) {
        return IERC20(underlying()).balanceOf(address(this));
    }

    /* Returns the current underlying (e.g., DAI's) balance together with
     * the invested amount (if DAI is invested elsewhere by the strategy).
     */
    function underlyingBalanceWithInvestment()
        public
        view
        override
        returns (uint256)
    {
        if (address(strategy()) == address(0)) {
            // initial state, when not set
            return underlyingBalanceInVault();
        }
        return
            underlyingBalanceInVault() +
            IStrategyV2(strategy()).investedUnderlyingBalance();
    }

    function getPricePerFullShare() public view override returns (uint256) {
        return
            totalSupply() == 0
                ? underlyingUnit()
                : (underlyingUnit() * (underlyingBalanceWithInvestment())) /
                    (totalSupply());
    }

    function getEstimatedWithdrawalAmount(
        uint256 numberOfShares
    ) public view override returns (uint256) {
        return (numberOfShares * (getPricePerFullShare())) / (underlyingUnit());
    }

    function underlyingBalanceWithInvestmentForHolder(
        address holder
    ) external view override returns (uint256) {
        if (totalSupply() == 0) {
            return 0;
        }
        return
            (underlyingBalanceWithInvestment() * (balanceOf(holder))) /
            (totalSupply());
    }

    function setStrategy(
        address _strategy
    ) public override onlyControllerOrGovernance {
        require(_strategy != address(0), "new _strategy cannot be empty");
        require(
            IStrategyV2(_strategy).underlying() == address(underlying()),
            "Vault underlying must match Strategy underlying"
        );
        require(
            IStrategyV2(_strategy).vault() == address(this),
            "the strategy does not belong to this vault"
        );

        emit StrategyChanged(_strategy, strategy());
        if (address(_strategy) != address(strategy())) {
            if (address(strategy()) != address(0)) {
                // if the original strategy (no underscore) is defined
                IERC20(underlying()).safeApprove(address(strategy()), 0);
                IStrategyV2(strategy()).withdrawAllToVault();
            }
            _setStrategy(_strategy);
            IERC20(underlying()).safeApprove(address(strategy()), 0);
            IERC20(underlying()).safeApprove(address(strategy()), 0);
        }
    }

    function doHardWork(address hardWorker) private {
        if (totalShareDeposit == 0) return;
        deposit();
        invest(hardWorker);
        IStrategyV2(strategy()).doHardWork();
        latestSharePrice = getPricePerFullShare();
        takeProfitSharePrice = latestSharePrice;
        HistoricalData memory data;
        data.rebalanceTimestamp = block.timestamp;
        data.sharePriceData = getPricePerFullShare();
        data.tvlData = underlyingBalanceWithInvestment();
        historicalData.push(data);
    }

    function rebalance(
        address hardWorker
    ) external override onlyControllerOrGovernance {
        if (totalSupply() == 0) {
            doHardWork(hardWorker);
        } else {
            require(
                block.timestamp >= nextTimeAbleToRebalance,
                "still not time to rebalance yet"
            );
            uint256 calculateSharePrice = getPricePerFullShare();

            // fee for rebalancer
            uint256 underlyingFeeForRebalancer = IStrategyV2(strategy())
                .calculateFeeForRebalance(); // check == 0 thi bo qua
            withdrawOrder[hardWorker] =
                (underlyingFeeForRebalancer * (underlyingUnit())) /
                (calculateSharePrice);
            withdrawer.push(hardWorker);

            // fee for nestquant
            uint256 feeForNestQuantInShare = 0;
            if (block.timestamp >= nextTimeToTakeProfit) {
                uint256 profitShare = (calculateSharePrice * (totalSupply())) /
                    (takeProfitSharePrice);
                // console.log("%s", takeProfitSharePrice);
                // console.log("%s", calculateSharePrice);

                if (profitShare > totalSupply()) {
                    profitShare = profitShare - (totalSupply());
                } else {
                    profitShare = 0;
                }
                feeForNestQuantInShare =
                    (profitShare * (sharingProfitFeeNumerator)) /
                    (sharingProfitFeeDenominator);
                // console.log("%s", sharingProfitFeeNumerator);
                // console.log("%s", sharingProfitFeeDenominator);

                // console.log("%s", feeForNestQuantInShare);
                nextTimeToTakeProfit = block.timestamp + periodToTakeProfit;
            }

            totalShareToWithdraw =
                totalShareToWithdraw +
                (feeForNestQuantInShare) +
                (withdrawOrder[hardWorker]);
            if (totalShareToWithdraw > totalSupply())
                totalShareToWithdraw = totalSupply();

            withdraw(
                totalShareToWithdraw,
                hardWorker,
                feeForNestQuantInShare,
                calculateSharePrice
            );

            deposit();
            invest(hardWorker);
            IStrategyV2(strategy()).doHardWork();
            latestSharePrice = getPricePerFullShare();
            if (block.timestamp >= nextTimeToTakeProfit) {
                takeProfitSharePrice = latestSharePrice;
            }

            nextTimeAbleToRebalance = block.timestamp + periodAbleToRebalance;
            HistoricalData memory data;
            data.rebalanceTimestamp = block.timestamp;
            data.sharePriceData = getPricePerFullShare();
            data.tvlData = underlyingBalanceWithInvestment();
            historicalData.push(data);
        }
    }

    function shouldWithdrawBack() public view override returns (uint256) {
        // return underlying
        uint256 wantInvestInTotal = (underlyingBalanceWithInvestment() *
            (vaultFractionToInvestNumerator())) /
            (vaultFractionToInvestDenominator());
        uint256 alreadyInvested = IStrategyV2(strategy())
            .investedUnderlyingBalance();
        if (alreadyInvested > wantInvestInTotal) {
            uint256 needToWithdrawBack = alreadyInvested - (wantInvestInTotal);
            return needToWithdrawBack;
        } else {
            return 0;
        }
    }

    function availableToInvestOut() public view override returns (uint256) {
        // return underlying
        uint256 wantInvestInTotal = (underlyingBalanceWithInvestment() *
            (vaultFractionToInvestNumerator())) /
            (vaultFractionToInvestDenominator());
        uint256 alreadyInvested = IStrategyV2(strategy())
            .investedUnderlyingBalance();
        if (alreadyInvested >= wantInvestInTotal) {
            return 0;
        } else {
            uint256 remainingToInvest = wantInvestInTotal - (alreadyInvested);
            return
                remainingToInvest < underlyingBalanceInVault()
                    ? remainingToInvest
                    : underlyingBalanceInVault();
        }
    }

    function invest(address hardWorker) internal whenStrategyDefined {
        if (totalSupply() == 0 && underlyingBalanceWithInvestment() > 0) {
            IERC20(underlying()).safeTransfer(
                controller(),
                underlyingBalanceWithInvestment()
            );
        }

        if (underlyingBalanceWithInvestment() == 0 || totalSupply() == 0)
            return;

        uint256 amountToWithdrawInShare = shouldWithdrawBack();
        if (amountToWithdrawInShare > 0) {
            IStrategyV2(strategy()).withdrawInUnderlying(
                amountToWithdrawInShare
            );
        }

        uint256 availableAmount = availableToInvestOut();
        if (availableAmount > 0) {
            IERC20(underlying()).safeTransfer(
                address(strategy()),
                availableAmount
            );
            emit Invest(availableAmount);
        }

        // fee for rebalancer
        uint256 underlyingFeeForRebalancer = IStrategyV2(strategy())
            .calculateFeeForRebalance();
        withdrawOrder[hardWorker] =
            (underlyingFeeForRebalancer * (underlyingUnit())) /
            (getPricePerFullShare());
        totalShareToWithdraw =
            totalShareToWithdraw +
            (withdrawOrder[hardWorker]);
        withdrawer.push(hardWorker);
    }

    function newDepositOrder(uint256 amount) external override defense {
        require(amount > 0, "Cannot deposit 0");

        IERC20(underlying()).safeTransferFrom(msg.sender, depositPool, amount);

        if (depositOrder[msg.sender] > 0) {
            depositOrder[msg.sender] += amount;
        } else {
            depositOrder[msg.sender] = amount;
        }
        depositer.push(msg.sender);
        totalShareDeposit += amount;
    }

    function deposit() private defense {
        if (IERC20(underlying()).balanceOf(depositPool) > 0) {
            IDepositPool(depositPool).takeDepositAmount();
            for (uint i = 0; i < depositer.length; i++) {
                uint256 depositOrderOf = depositOrder[depositer[i]];
                if (depositOrderOf > 0) {
                    _deposit(depositOrderOf, depositer[i]);
                }
                depositOrder[depositer[i]] = 0;
            }
        }
        totalShareDeposit = 0;
        delete depositer;
    }

    function withdrawAll()
        public
        override
        onlyControllerOrGovernance
        whenStrategyDefined
    {
        IStrategyV2(strategy()).withdrawAllToVault();
    }

    function newWithdrawOrder(uint256 numberOfShares) external override {
        require(numberOfShares > 0, "numberOfShares must be greater than 0");
        require(totalSupply() > 0, "Vault has no shares");
        require(
            numberOfShares + withdrawOrder[msg.sender] <= balanceOf(msg.sender),
            "you don't have enough share"
        );

        if (withdrawOrder[msg.sender] > 0) {
            withdrawOrder[msg.sender] += numberOfShares;
        } else {
            withdrawOrder[msg.sender] = numberOfShares;
        }
        withdrawer.push(msg.sender);
        numberOfWithdrawer++;
        totalShareToWithdraw += numberOfShares;
    }

    function withdraw(
        uint256 numberOfShares,
        address hardWorker,
        uint256 shareForNestQuant,
        uint256 sharePrice
    ) private {
        // console.log("Start withdraw");
        uint256 totalSupply = totalSupply();
        // console.log("total supply %s", totalSupply);
        uint256 shareInVault = (underlyingBalanceInVault() *
            (underlyingUnit())) / (sharePrice);
        // console.log("share in vault %s", shareInVault);
        uint256 totalUnderlyingShouldWithdraw = (numberOfShares *
            (sharePrice)) / (underlyingUnit());
        // console.log("underlying to withdraw %s", totalUnderlyingShouldWithdraw);
        uint256 underlyingRealToDivide = 0;

        if (numberOfShares == totalSupply) {
            IStrategyV2(strategy()).withdrawAllToVault();
            underlyingRealToDivide = underlyingBalanceInVault();
        } else {
            if (numberOfShares > shareInVault) {
                uint256 missingShare = numberOfShares - (shareInVault);
                IStrategyV2(strategy()).withdrawToVault(
                    missingShare,
                    totalSupply
                );
                underlyingRealToDivide = underlyingBalanceInVault();
            } else {
                underlyingRealToDivide = numberOfShares * (sharePrice);
            }
        }
        sharePrice = getPricePerFullShare();

        uint256 feeHardWorker = (withdrawOrder[hardWorker] * (sharePrice)) /
            (underlyingUnit());

        if (feeHardWorker > 0 && underlyingBalanceInVault() > feeHardWorker) {
            IERC20(underlying()).safeTransfer(
                address(hardWorker),
                feeHardWorker
            );
        }

        uint256 feeNestQuant = (shareForNestQuant * (sharePrice)) /
            (underlyingUnit());

        if (feeNestQuant > 0 && underlyingBalanceInVault() > feeNestQuant) {
            IERC20(underlying()).safeTransfer(underlyingPool(), feeNestQuant);
        }

        underlyingRealToDivide =
            underlyingRealToDivide -
            feeHardWorker -
            feeNestQuant;
        totalUnderlyingShouldWithdraw =
            totalUnderlyingShouldWithdraw -
            feeHardWorker -
            feeNestQuant;

        withdrawOrder[hardWorker] = 0; 

        if (numberOfWithdrawer > 0) {
            uint256 missingUnit = 0;
            if (totalUnderlyingShouldWithdraw > underlyingRealToDivide) {
                missingUnit =
                    totalUnderlyingShouldWithdraw -
                    (underlyingRealToDivide) /
                    (numberOfWithdrawer);
            }
            uint256 amountToWithdraw = 0;
            for (uint256 i = 0; i < withdrawer.length - 1; i++) {
                if (withdrawOrder[withdrawer[i]] > 0) {
                    amountToWithdraw =
                        (withdrawOrder[withdrawer[i]] * (sharePrice)) /
                        (underlyingUnit());
                    if (amountToWithdraw > missingUnit) {
                        if (amountToWithdraw > underlyingBalanceInVault()) {
                            IERC20(underlying()).safeTransfer(
                                withdrawer[i],
                                underlyingBalanceInVault()
                            );
                            _burn(withdrawer[i], withdrawOrder[withdrawer[i]]);
                            emit Withdraw(
                                withdrawer[i],
                                underlyingBalanceInVault()
                            );
                        } else {
                            IERC20(underlying()).safeTransfer(
                                withdrawer[i],
                                amountToWithdraw - (missingUnit)
                            );
                            _burn(withdrawer[i], withdrawOrder[withdrawer[i]]);
                            emit Withdraw(withdrawer[i], amountToWithdraw);
                        }
                    }
                    withdrawOrder[withdrawer[i]] = 0;
                }
            }
        }

        if (underlyingBalanceWithInvestment() == 0) {
            for (uint i = 0; i < withdrawer.length; i++) {
                if (balanceOf(withdrawer[i]) > 0) {
                    _burn(withdrawer[i], balanceOf(withdrawer[i]));
                }
            }
        }
        totalShareToWithdraw = 0;
        numberOfWithdrawer = 0;
        delete withdrawer;
    }

    function _deposit(uint256 amount, address beneficiary) internal {
        require(amount > 0, "Cannot deposit 0");
        require(beneficiary != address(0), "holder must be defined");

        if (address(strategy()) != address(0)) {
            require(IStrategyV2(strategy()).depositArbCheck(), "Too much arb");
        }

        uint256 fee = (amount * (depositFeeNumerator)) /
            (depositFeeDenominator);

        uint256 toMint = amount -
            ((fee) * (underlyingUnit())) /
            (getPricePerFullShare());

        _mint(beneficiary, toMint);

        totalShareDeposit += toMint;

        if (fee > 0) {
            IERC20(underlying()).safeTransfer(underlyingPool(), fee);
            // IUnderlyingPool(underlyingPool()).depositFeeForSharingProfit(fee);
        }
        // console.log("nestquant take %s for deposit fee", fee);

        emit Deposit(beneficiary, amount - (fee));
    }

    function calulateAPY() public view returns (uint256) {
        if (totalSupply() == 0) return 0;
        if (historicalData.length == 0) return 0;
        uint256 length = historicalData.length;

        HistoricalData memory data = historicalData[0]; 
        if (length > 15) {
            data = historicalData[length - 14]; 
        }

        if (latestSharePrice > data.sharePriceData) {
            uint256 priceDiffInSecond = ((latestSharePrice * underlyingUnit()) /
                data.sharePriceData) / 
                (historicalData[length - 1].rebalanceTimestamp -
                    data.rebalanceTimestamp);
            uint256 apy = priceDiffInSecond * 31556926 - underlyingUnit();
            return apy;
        }

        return 0;
    }

    function multicall()
        public
        view
        returns (
            string memory name,
            uint256 apy,
            uint256 tvl,
            uint256 sharePrice,
            uint8 _decimals
        )
    {
        name = IStrategyV2(strategy()).name();
        apy = calulateAPY();
        tvl = underlyingBalanceWithInvestment();
        sharePrice = getPricePerFullShare();
        _decimals = decimals();
    }

    function getHistoricalData() public view returns (HistoricalData[] memory) {
        uint256 length = historicalData.length < 30
            ? historicalData.length
            : 30;

        HistoricalData[] memory truncatedData = new HistoricalData[](length);
        for (uint256 i = 0; i < length; i++) {
            truncatedData[i] = historicalData[i];
        }

        return truncatedData;
    }
}
"
    },
    "contracts/VaultStorage.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity <0.8.0;
pragma abicoder v2;
import "@openzeppelin/contracts-upgradeable/proxy/Initializable.sol";

contract VaultStorage is Initializable {
    bytes32 internal constant _STRATEGY_SLOT =
        0xf1a169aa0f736c2813818fdfbdc5755c31e0839c8f49831a16543496b28574ea;
    bytes32 internal constant _UNDERLYING_SLOT =
        0x1994607607e11d53306ef62e45e3bd85762c58d9bf38b5578bc4a258a26a7371;
    bytes32 internal constant _UNDERLYING_UNIT_SLOT =
        0xa66bc57d4b4eed7c7687876ca77997588987307cb13ecc23f5e52725192e5fff;
    bytes32 internal constant _VAULT_FRACTION_TO_INVEST_NUMERATOR_SLOT =
        0x39122c9adfb653455d0c05043bd52fcfbc2be864e832efd3abc72ce5a3d7ed5a;
    bytes32 internal constant _VAULT_FRACTION_TO_INVEST_DENOMINATOR_SLOT =
        0x469a3bad2fab7b936c45eecd1f5da52af89cead3e2ed7f732b6f3fc92ed32308;
    bytes32 internal constant _NEXT_IMPLEMENTATION_SLOT =
        0xb1acf527cd7cd1668b30e5a9a1c0d845714604de29ce560150922c9d8c0937df;
    bytes32 internal constant _NEXT_IMPLEMENTATION_TIMESTAMP_SLOT =
        0x3bc747f4b148b37be485de3223c90b4468252967d2ea7f9fcbd8b6e653f434c9;
    bytes32 internal constant _NEXT_IMPLEMENTATION_DELAY_SLOT =
        0x82ddc3be3f0c1a6870327f78f4979a0b37b21b16736ef5be6a7a7a35e530bcf0;
    bytes32 internal constant _UNDERLYING_POOL_SLOT =
        0xb8a3f2cbd68ee7df3e67e1833c340431fbf72a36761d84c813500acc329d3329; // ?

    constructor() {
        assert(
            _STRATEGY_SLOT ==
                bytes32(uint256(keccak256("eip1967.vaultStorage.strategy")) - 1)
        );
        assert(
            _UNDERLYING_SLOT ==
                bytes32(
                    uint256(keccak256("eip1967.vaultStorage.underlying")) - 1
                )
        );
        assert(
            _UNDERLYING_UNIT_SLOT ==
                bytes32(
                    uint256(keccak256("eip1967.vaultStorage.underlyingUnit")) -
                        1
                )
        );
        assert(
            _VAULT_FRACTION_TO_INVEST_NUMERATOR_SLOT ==
                bytes32(
                    uint256(
                        keccak256(
                            "eip1967.vaultStorage.vaultFractionToInvestNumerator"
                        )
                    ) - 1
                )
        );
        assert(
            _VAULT_FRACTION_TO_INVEST_DENOMINATOR_SLOT ==
                bytes32(
                    uint256(
                        keccak256(
                            "eip1967.vaultStorage.vaultFractionToInvestDenominator"
                        )
                    ) - 1
                )
        );

        assert(
            _UNDERLYING_POOL_SLOT ==
                bytes32(
                    uint256(keccak256("eip1967.vaultStorage.underlyingPool")) -
                        1
                )
        );
    }

    function initialize(
        address _underlying_,
        uint256 _toInvestNumerator,
        uint256 _toInvestDenominator,
        uint256 _underlyingUnit_,
        address _underlyingPool_
    ) public initializer {
        _setUnderlying(_underlying_);
        _setVaultFractionToInvestNumerator(_toInvestNumerator);
        _setVaultFractionToInvestDenominator(_toInvestDenominator);
        _setUnderlyingUnit(_underlyingUnit_);
        _setUnderlyingPool(_underlyingPool_); 
    }

    function _setUnderlyingPool(address _pool) internal {
        setAddress(_UNDERLYING_POOL_SLOT, _pool);
    }

    function _underlyingPool() internal view returns (address) {
        return getAddress(_UNDERLYING_POOL_SLOT);
    }

    function _setStrategy(address _address) internal {
        setAddress(_STRATEGY_SLOT, _address);
    }

    function _strategy() internal view returns (address) {
        return getAddress(_STRATEGY_SLOT);
    }

    function _setUnderlying(address _address) internal {
        setAddress(_UNDERLYING_SLOT, _address);
    }

    function _underlying() internal view returns (address) {
        return getAddress(_UNDERLYING_SLOT);
    }

    function _setUnderlyingUnit(uint256 _value) internal {
        setUint256(_UNDERLYING_UNIT_SLOT, _value);
    }

    function _underlyingUnit() internal view returns (uint256) {
        return getUint256(_UNDERLYING_UNIT_SLOT);
    }

    function _setVaultFractionToInvestNumerator(uint256 _value) internal {
        setUint256(_VAULT_FRACTION_TO_INVEST_NUMERATOR_SLOT, _value);
    }

    function _vaultFractionToInvestNumerator() internal view returns (uint256) {
        return getUint256(_VAULT_FRACTION_TO_INVEST_NUMERATOR_SLOT);
    }

    function _setVaultFractionToInvestDenominator(uint256 _value) internal {
        setUint256(_VAULT_FRACTION_TO_INVEST_DENOMINATOR_SLOT, _value);
    }

    function _vaultFractionToInvestDenominator()
        internal
        view
        returns (uint256)
    {
        return getUint256(_VAULT_FRACTION_TO_INVEST_DENOMINATOR_SLOT);
    }

    function setBoolean(bytes32 slot, bool _value) internal {
        setUint256(slot, _value ? 1 : 0);
    }

    function getBoolean(bytes32 slot) internal view returns (bool) {
        return (getUint256(slot) == 1);
    }

    function setAddress(bytes32 slot, address _address) private {
        // solhint-disable-next-line no-inline-assembly
        assembly {
            sstore(slot, _address)
        }
    }

    function setUint256(bytes32 slot, uint256 _value) private {
        // solhint-disable-next-line no-inline-assembly
        assembly {
            sstore(slot, _value)
        }
    }

    function getAddress(bytes32 slot) private view returns (address str) {
        // solhint-disable-next-line no-inline-assembly
        assembly {
            str := sload(slot)
        }
    }

    function getUint256(bytes32 slot) private view returns (uint256 str) {
        // solhint-disable-next-line no-inline-assembly
        assembly {
            str := sload(slot)
        }
    }
}
"
    },
    "hardhat/console.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

library console {
    address constant CONSOLE_ADDRESS =
